import { ProductItem } from "./ProductList";

export function ProdctItem({date}){
    return <div className="col-md-6">
        <table className="table table-dark table-bordered">
            <thead>
                <tr>
                    <th>Title</th>
                    <th>Name</th>
                    <th>Salery</th>
                </tr>
            </thead>
            <tbody>
                {
                    date.map(elm => {
                        return <ProductItem {...elm} />
                    })


                }
            </tbody>

        </table>

    </div>
}
